webpackJsonp([0x926b81818e5f9000],{"./node_modules/json-loader/index.js!./.cache/json/sql-sql-delete-statement.json":function(e,s){e.exports={data:{markdownRemark:{html:'<h2>SQL Delete Statement</h2>\n<p>To delete a record in a table you use the <code>DELETE</code> statement. </p>\n<p>Be careful. You can delete all records of the table or just a few. Use the <code>WHERE</code> condition to specify which records do you want to delete. The syntax is:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">DELETE</span> <span class="token keyword">FROM</span> table_name\n<span class="token keyword">WHERE</span> condition<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Here is an example deleting from the table Person the record with Id 3:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">DELETE</span> <span class="token keyword">FROM</span> Person\n<span class="token keyword">WHERE</span> Id <span class="token operator">=</span> <span class="token number">3</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>',fields:{slug:"/sql/sql-delete-statement/"},frontmatter:{title:"SQL Delete Statement"}}},pathContext:{slug:"/sql/sql-delete-statement/"}}}});
